/*
import React from "react"
class Body extends React.Component {
  state = {
    stateOne: "stateA"
  };
  render() {
    return (
    <div className="Body">
     <h3 id="bodyTitle">This is the body title</h3>
     <p id="bodyContents">To be filled with lots of contents in the future</p>
    </div>
  );
  }
}
export default Body;
*/
